import React from "react";
import Table from "react-bootstrap/Table";

import "./ViewList.css";

const ViewList = (props) => {
  console.log(props.items);
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col">
            {props.items.map((obj) => (
              <Table striped>
                <thead key={obj.id}>
                  <tr>
                    <th>Name</th>
                    <th>Last Name</th>
                    <th>Email</th>
                    <th>Age</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>{obj.name}</td>
                    <td>{obj.name}</td>
                    <td>{obj.name}</td>
                    <td>{obj.name}</td>
                    <td>{obj.name}</td>
                  </tr>
                </tbody>
              </Table>
            ))}
          </div>
        </div>
      </div>
    </>
  );
};

export default ViewList;
